import React from "react";
import Tree from "react-d3-tree";
import styles from "./TreeComponent.module.css";
import CenteredTree from "./CenteredTree";

const myTreeData = [
  {
    name: "Top Level",
    attributes: {
      key: "value"
    },
    children: [
      {
        name: "Level 2: A",
        children: [
          { name: "Level 3: A" },
          { name: "Level 3: B" },
          { name: "Level 3: C" }
        ]
      },
      {
        name: "Level 2: B",
        children: [
          { name: "Level 3: A" },
          { name: "Level 3: B" },
          { name: "Level 3: C" }
        ]
      }
    ]
  }
];

const TreeComponent = () => {
  return (
    <div className={styles.tree}>
      <CenteredTree
        data={myTreeData}
        orientation="vertical"
        onClick={nodeData => console.log(nodeData)}
        collapseable={false}
      />
      ;
    </div>
  );
};

export default TreeComponent;
